import React, { useState, useEffect, useRef } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import L from "leaflet";

const DroneMap = () => {
  const [droneData, setDroneData] = useState([]);
  const socketRef = useRef(null);

  useEffect(() => {
    // Fetch initial drone data
    fetch("http://localhost:8000/fetch-drones")
      .then((response) => response.json())
      .then((data) => {
        if (data.drones) {
          setDroneData(data.drones);
        }
      })
      .catch((error) => console.error("âŒ Error fetching drone data:", error));

    // WebSocket Connection
    socketRef.current = new WebSocket("ws://localhost:8000/ws");

    socketRef.current.onopen = () => {
      console.log("âœ… WebSocket Connected");
      socketRef.current.send("Hello from React!");
    };

    socketRef.current.onmessage = (event) => {
      console.log("ðŸ“¡ Live Drone Update:", event.data);
      try {
        const updatedData = JSON.parse(event.data);
        if (Array.isArray(updatedData)) {
          setDroneData(updatedData);
        }
      } catch (error) {
        console.error("âŒ Error parsing WebSocket data:", error);
      }
    };

    socketRef.current.onerror = (error) => {
      console.error("âŒ WebSocket Error:", error);
    };

    socketRef.current.onclose = () => {
      console.warn("âš ï¸ WebSocket Disconnected");
    };

    return () => {
      if (socketRef.current) {
        socketRef.current.close();
      }
    };
  }, []);

  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h2>ðŸš€ <strong>Illegal Drone Traffic Tracking</strong></h2>
      <p>Monitoring real-time drone activity & alerts ðŸ“¡</p>

      <MapContainer center={[37.7749, -122.4194]} zoom={5} style={{ height: "600px", width: "90%", margin: "auto" }}>
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
        {droneData.map((drone, index) =>
          drone.latitude && drone.longitude ? (
            <Marker
              key={index}
              position={[drone.latitude, drone.longitude]}
              icon={L.icon({
                iconUrl: drone.velocity > 50 ? "/assets/red_marker.png" : "/assets/green_marker.png",
                iconSize: [25, 41],
                iconAnchor: [12, 41],
                popupAnchor: [1, -34],
              })}
            >
              <Popup>
                <strong>Callsign: </strong>{drone.callsign}<br />
                <strong>Country: </strong>{drone.country}<br />
                <strong>Altitude: </strong>{drone.altitude} meters<br />
                <strong>Velocity: </strong>{drone.velocity} km/h
              </Popup>
            </Marker>
          ) : null
        )}
      </MapContainer>

      <div style={{ marginTop: "20px", textAlign: "left", width: "90%", margin: "auto", padding: "15px", background: "#f8f9fa", borderRadius: "8px" }}>
        <h3>ðŸ“Š <strong>Live Drone Updates</strong></h3>
        <p style={{ color: "#ff5733" }}>âš¡ <strong>Avg Velocity:</strong> {droneData.length ? (droneData.reduce((acc, d) => acc + d.velocity, 0) / droneData.length).toFixed(2) : "0"} km/h</p>
        <ul>
          {droneData.map((drone, index) => (
            <li key={index}>
              <strong>{drone.callsign} ({drone.country})</strong> - Lat: {drone.latitude}, Lon: {drone.longitude}, Alt: {drone.altitude} meters, Vel: {drone.velocity} km/h
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default DroneMap;
